	function getBase64() {
		$('#final').find('img').each(function() {
			var tmp_id = Math.floor((Math.random() * 10000) + 1);
			var src = $(this).attr('src');
			if (src.indexOf('/static/') >= 0)
				src = 'http://8ch.net' + src;
			if(src.indexOf('media.8ch.net') >= 0 || src.indexOf('media2.8ch.net') >= 0 || src.indexOf('img.youtube.com') >= 0 || src.indexOf('8ch.net') >= 0) {
				$(this).attr('id', tmp_id);
				if (src.indexOf('img.youtube.com') >= 0)
					src = src.replace('//', 'http://');
				$.ajax({
					url: encodeURI(scapProxyUri + src + '&id=' + tmp_id),
					success: function(result) {
						$('#'+result['id']).attr('src', result['src']);
			    }
			  });
			}
		});
	}
	$('#screencap').click(function() {
		if($('#final').html() == '' || $('#screencap').text() == '[Grabbing...]')
			return;
		$('#screencap').text("[Grabbing...]");
		var dmn = window.location.href.split('//');
		dmn = dmn[1].split('/')[0] + '/' + dmn[1].split('/')[1];
		var location = '<div style="float:right;margin-right:10px;font-size:18px;color:'+$('body').css('color')+';background-color:'+$('body').css('backgroundColor')+';"><center><img src="' + scapLogo + '" style="width:73px;height:48px;"><br>' + dmn + '</center><br></div><br>';
		$('#final').append(location);
		$('#final').css({display:'block', width:scapMainWidth+'px'});
		$('#final').find('input[type=checkbox]').remove();
		if (scapSafari) {
			html2canvas($('#final'), {
				width: scapMainWidth + 3,
				onrendered: function(canvas) {
					var scap = canvas.toDataURL();
					$('#scap-safari-src').attr('src', scap);
					$('#scap-modal').css('display','block');
					$('#final').html('');
					$('#final').css('display', 'none');
					scapMainWidth = 0;
					$('.thread').find('.post').find('.scap').each(function() {
						$(this).prop('checked', false);
					});
					$('#screencap').text("[Grab]");
				}
			});
		} else {
			var node = document.getElementById('final');
			domtoimage.toPng(node).then(function (dataUrl) {
      	var link = document.createElement('a');
        document.body.appendChild(link);
        link.setAttribute("type", "hidden");
        link.setAttribute("id", "tmpClick");
        link.download = Date.now() + '.png';
        link.href = dataUrl;
        link.click();
        $('#tmpClick').remove();
	      $('#final').html('');
				$('#final').css('display', 'none');
				scapMainWidth = 0;
				$('.thread').find('.post').find('.scap').each(function() {
					$(this).prop('checked', false);
				});
				$('#screencap').text("[Grab]");
	    }).catch(function (error) {
	      console.error('oops, something went wrong!', error);
				$('#screencap').text("[Grab]");
	    });
		}
	});
 	$(document).on("change", ".scap", function() {
    if(this.checked) {
    	if($(this).parent().parent().parent().width() > scapMainWidth)
    		scapMainWidth = $(this).parent().parent().parent().width();
    	var tmp = $(this).parent().parent().parent().clone().wrap('<p/>').parent().html();
    	if($(this).parent().parent().parent().prev().hasClass('files')) {
    		tmp = '<div class="files">' + $(this).parent().parent().parent().prev().html() + '</div>' + tmp;
    	} else if($(this).parent().parent().parent().prev().hasClass('video-container')) {
    		tmp = '<div class="video-container">' + $(this).parent().parent().parent().prev().html() + '</div>' + tmp;
    	}
  		$('#final').append(tmp + '<br>');
  		getBase64();
    } else {
    	if($('#final').find('#'+$(this).parent().parent().parent().attr('id')).prev().hasClass('files') || $('#final').find('#'+$(this).parent().parent().parent().attr('id')).prev().hasClass('video-container'))
    		$('#final').find('#'+$(this).parent().parent().parent().attr('id')).prev().remove();
    	$('#final').find('#'+$(this).parent().parent().parent().attr('id')).next().remove();
    	$('#final').find('#'+$(this).parent().parent().parent().attr('id')).remove();
    }
	});
